import ReactDOM from "react-dom";
import React from "react";
import App from "../App";
import {addPost} from "./state";

export let rendererer = (props) => {
    return(
        ReactDOM.render(
            <React.StrictMode>
                <App addPost = {addPost} appState={props.state}/>
            </React.StrictMode>,
            document.getElementById('root')
        )
    )
}
